import React from "react";
import styled from "styled-components";
import landing from "../background.jpg";
import googleIcon from "../googleIcon.png";

const Main = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  height: 100%;
  align-items: center;
  margin: 0;
  padding: 0;
`;

const LeftContainer = styled.div`
  background: white;
  height: 100%;
  width: 40%;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 70px;
`;

const RightContainer = styled.div`
  height: 100%;
  width: 60%;
  background: url(${landing});
  background-size: cover;
`;

const LoginText = styled.h1`
  font-family: "Poppins";
  font-weight: 700;
  font-size: 26px;
  color: black;
  width: 70%;
`;

const Text2 = styled.h6`
  font-family: "Quicksand";
  font-weight: 500;
  font-size: 14px;
  color: #989898;
  margin-top: 8px;
  width: 70%;
`;

const SignInWithGoogle = styled.div`
  width: 70%;
  height: 38px;
  border-radius: 20px;
  margin-top: 40px;
  box-shadow: rgba(0, 0, 0, 0.05) 0px 6px 24px 0px,
    rgba(0, 0, 0, 0.08) 0px 0px 0px 1px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const GoogleIcon = styled.div`
  background: url(${googleIcon});
  background-size: cover;
  width: 20px;
  height: 20px;
  margin-right: 8px;

  img {
    width: 100%;
    height: 100%;
  }
`;

const Text3 = styled.h5`
  font-family: "Poppins";
  font-weight: 600;
  font-size: 12px;
  color: black;
`;

const Text4 = styled.h6`
  font-family: "Quicksand";
  font-weight: 500;
  font-size: 11px;
  color: #989898;
  background-color: white;
  margin: 30px auto;
  width: 70%;
  display: inline-block;

  &:before,
  &:after {
    background-color: #d3d3d3;
    content: "";
    display: inline-block;
    height: 0.01em;
    position: relative;
    vertical-align: middle;
    width: 30%;
  }

  &:before {
    right: 0.5em;
    margin-left: 10px;
  }

  &:after {
    left: 0.5em;
    margin-right: 10px;
  }
`;

const Text5 = styled.h5`
  font-family: "Roboto";
  font-weight: 700;
  font-size: 12px;
  color: black;
  margin-top: 20px;
  width: 70%;
`;

const BackgroundFilter = styled.div`
  height: 100%;
  width: 100%;
  background-color: rgba(38, 70, 83, 0.7);
  display: flex;
`;

const InputBox = styled.input`
  width: 68%;
  height: 36px;
  margin-top: 10px;
  border-radius: 5px;
  padding: 0px 10px;
  margin-bottom: 20px;
  border: 1px solid #d3d3d3;
`;

const CheckboxContainer = styled.div`
  width: 70%;
  height: 10px;
  display: flex;
  margin-top: 8px;
`;

const CheckBox = styled.input`
  padding 1px;
  margin-right: 10px;
  &:checked {
    background: #1e90ff;
  }
`;

const CheckboxLabel = styled.h5`
  font-family: "Roboto";
  font-weight: 500;
  font-size: 13px;
  color: #555555;
  width: 50%;
`;

const Button = styled.button`
  width: 70%;
  height: 40px;
  color: white;
  background-color: #1e90ff;
  border: none;
  border-radius: 8px;
  margin-top: 50px;
`;

function SignupPage() {
  return (
    <Main>
      <LeftContainer>
        <LoginText>Login</LoginText>
        <Text2>
          Login with your data that you entered during your registration.
        </Text2>
        <SignInWithGoogle>
          <GoogleIcon />
          <Text3>Sign In with Google</Text3>
        </SignInWithGoogle>
        <Text4>or Sign In with Email</Text4>
        <Text5>Email</Text5>
        <InputBox type="email" placeholder="example@gmail.com" />
        <Text5>Password</Text5>
        <InputBox type="password" placeholder="at leat 8 characters" />
        <CheckboxContainer>
          <CheckBox type="checkbox" />
          <CheckboxLabel>Keep me logged in</CheckboxLabel>
        </CheckboxContainer>
        <Button>Login</Button>
      </LeftContainer>
      <RightContainer>
        <BackgroundFilter />
      </RightContainer>
    </Main>
  );
}

export default SignupPage;
